import React from 'react';
import Navbar from './components/Navbar';
import RegistrationBoxes from './components/RegistrationBoxes';
import Footer from './components/Footer';
import './App.css';

function App() {
  return (
    <>
      <Navbar />
      <main>
        <RegistrationBoxes />
      </main>
      <Footer />
    </>
  );
}

export default App;
